function createMorphologyTableForSentence(dataset, datasetName){
    let display = "<h1>" + datasetName + "</h1>";
    for (let index = 0; index < dataset.length; index++) {
        let words = dataset[index]["sentence"].split(' ');
        let morphology = dataset[index]["INFLECTIONAL_GROUP"].split(' ')
        display = display + "<table> <tr> <th><b>Word</b></th> <th> <b>Morphology </b></th> </tr>";
        for (let i = 0; i < words.length; i++) {
            display = display + "<tr><td>" + words[i] + "</td><td>" + morphology[i] + "</td></tr>"
        }
        display = display + "</table>"
    }
    return display
}

document.getElementById("result").innerHTML = createMorphologyTableForSentence(atis, "Atis");
